import React from 'react';
import { CircularProgressBar } from "@tomik23/react-circular-progress-bar";

const App = () => {
    const props = {
        percent: 60, // is require
        // colorSlice: "#00a1ff",
        colorCircle: "rgb(250, 34, 90)",
        fontColor: "#365b74",
        // fontSize: "1.6rem",
        // fontWeight: 400,
        // size: 200,
        stroke: 2,
        // strokeBottom: 5,
        // speed: 60,
        // cut: 0,
        // rotation: -90,
        // opacity: 10,
        // fill: "#00897B",
        // unit: "%",
        // textPosition: "0.35em",
        // animationOff: false,
        // inverse: false,
        // round: false,
        // number: true,
        // linearGradient: ["#ffff00", "brown"]
      };
    return (
        <>
            <CircularProgressBar {...props} />
        </>
    )
}

export default App
